import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Weather App</h1>
        <h2>Location Name</h2>
        <h3 className="text-danger">Temperature</h3>
        <h3>Weather Description</h3>
      </div>
    );
  }
}

export default App;
